import axios from 'axios';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Form, Button, FloatingLabel } from 'react-bootstrap'
import React, { Component } from 'react'

class Signup extends Component {
    constructor(props) {
      super(props)

      this.state = {
        name:'',
        username:'',
        email:'',
        pwd:''

    }
    }
  render() {
    const {name, username, email, pwd} = this.state;

    return (
        <Form className='m-5'>
            <h1 className='text-center display-4'> Sign Up</h1>
            <FloatingLabel controlId="floatingInput" label="Name" className='mb-3 ' value ={name} >
                <Form.Control type="text" placeholder="Name" />
            </FloatingLabel>
            <FloatingLabel controlId="floatingInput" label="Username" className='mb-3' value={username} >
                <Form.Control type="text" placeholder="UserName" />
            </FloatingLabel>

            <FloatingLabel controlId="floatingInput" label="Email address" className='mb-3' value={email} onChange={event => console.log(event.target.value)}>
                <Form.Control type="email" placeholder="name@example.com" />

            </FloatingLabel>

            <FloatingLabel controlId="floatingInput" label="Password" className='mb-3' value={pwd} >
                <Form.Control type="password" placeholder="Password" />
            </FloatingLabel>

            <Button className='mt-3' variant="primary" type="submit">
                Submit
            </Button>
        </Form>
    )
  }
}

export default Signup;
